 * Encode basic credentials
 * @param {string} clientId - The client Id to encode
 * @param {string} clientSecret - The client secret to encode
 * @returns {string} base64 encoded clientId:clientSecret
 */
module.exports = a = async ({ params }) => {
  const clientId = params.clientId;
  const clientSecret = params.clientSecret;

  // If either value is missing, return an error
  if (!clientId || !clientSecret) {
    return false;
